import { Carousel } from "react-bootstrap";
import { render } from "react-dom";


export function showImage(){
  const pics = ['data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',
              'data:image/jpeg;base64,',    
  ];
  
  let carouse_items;
  for(let pic in pics){
      carouse_items += 
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="{pics[pic]}"
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>{pic} slide label</h3>
          </Carousel.Caption>
        </Carousel.Item>
      
      console.log(pics,pic);
  }
  return(carouse_items)

}